import HeroSection from '../../HeroSection';
import { aboutMeObj } from './Data';

function Products() {
  return (
    <>
      <HeroSection style={{ background: rgb(233, 111, 37) }} {...aboutMeObj} />
    </>
  );
}

export default Products;
